import React from 'react'
import CyberExposureScore from "./cyberexposurescore"
import ExposureTrends from "./exposuretrends"
class Dashboardcontent extends React.Component{
    constructor(props){
        super()
        
    }
render(){
    return(
        <div>
            <div className="div1">
                <div className="div1in1">
                    <div className="dc1">
                        <CyberExposureScore/>
                    </div>
                    <div className="dc2">

                    </div>
                </div>
                <div className="div1in2">
                <div className="dac1">
                    <ExposureTrends/>
                </div>
                <div className="dac2">

                </div>

                </div>
            </div>
        
        
        <style>{`
        .div1{
            display:flex;
            flex-direction:column;
            align-items:center;
            
            width:100%;
            height:950px;
            justify-content:space-evenly;
        }
        .div1in1{
            display:flex;
            flex-direction:row;
            
            width:90%;
            height:48%;
            flex-wrap:wrap;
            justify-content:space-evenly;
            
        }
        .div1in2{
            display:flex;
            flex-direction:row;
            
            flex-wrap:wrap;
            width:90%;
            height:48%;
            justify-content:space-evenly;
            
        }
        .dc1{
            display:flex;
            border: 0.5px solid #dddfe6;;
            box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
            background:#F9F9F9;
            width:48%;
            
            
        }
        .dc2{
            display:flex;
            border: 0.5px solid #dddfe6;;
            box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
            background:#F9F9F9;
            width:48%;
            flex-basis:48%;
            
            
        }
        .dac1{
            border: 0.5px solid #dddfe6;;
            box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
            background:#F9F9F9;
            width:48%;
            
            
        }
        .dac2{
            border: 0.5px solid #dddfe6;;
            box-shadow: 0 20px 60px 0 rgba(163, 171, 186, 0);
            background:#F9F9F9;
            width:48%;
            
            
        }
        @media (max-width: 1500px) {
            .div1{
                display:flex;
                flex-direction:column;
                align-items:center;
                
                width:100%;
                height:2000px;
                justify-content:space-evenly;
            }
            .div1in1{
                display:flex;
                flex-direction:column;
                
                width:90%;
                height:48%;
                flex-wrap:wrap;
                align-items:center;
                justify-content:space-evenly;
                
            }
            .dc1{
                display:flex;
                
                height:48%;
                width:100%;
                  
            }
            .dc2{
                display:flex;
                
                height:48%;
                width:100%;
                
                
            }
            .div1in2{
                display:flex;
                flex-direction:column;
                
                width:90%;
                height:48%;
                flex-wrap:wrap;
                align-items:center;
                justify-content:space-evenly;
                
            }
            .dac1{
                display:flex;
                
                height:48%;
                width:100%;
                  
            }
            .dac2{
                display:flex;
                
                height:48%;
                width:100%;
                
                
            }

        
        `}

        </style>
        
        
        
        </div>
    )


    }



}
export default Dashboardcontent;
